void WinMain_DateUpdate(void)
{
	WM_HWIN hItem;
	char i,j,buf[10],ch=0;
	for(i=0;i<3;i++)//
	{
		hItem = WM_GetDialogItem(hWinWindow, ID_TEXT_4+i);
		if(Master_Data.NMTable[1+i]==0x00) TEXT_SetText(hItem, "Initialisation");
		if(Master_Data.NMTable[1+i]==0x01) TEXT_SetText(hItem, "Disconnected");
		if(Master_Data.NMTable[1+i]==0x02) TEXT_SetText(hItem, "Connecting");
		if(Master_Data.NMTable[1+i]==0x04) TEXT_SetText(hItem, "Stopped");
		if(Master_Data.NMTable[1+i]==0x05) TEXT_SetText(hItem, "Operational");
		if(Master_Data.NMTable[1+i]==0x7F) TEXT_SetText(hItem, "Pre_operational");
		if(Master_Data.NMTable[1+i]==0x0F) TEXT_SetText(hItem, "Unknown_state");
	}
	for(i=0;i<3;i++)//
	{
		hItem = WM_GetDialogItem(hWinWindow, ID_BUTTON_1+i);
		if(Master_Data.NMTable[1+i]!=0x04) BUTTON_SetText(hItem, "Stop");
		if(Master_Data.NMTable[1+i]==0x04) BUTTON_SetText(hItem, "Start");
	}
	ch = 0;
	for(i=0;i<2;i++)//
	{
		for(j=0;j<3;j++)
		{
			hItem = WM_GetDialogItem(hWinWindow, ID_para(ch++));
//			if(i==0)sprintf(buf, "%3.2f", Float_Distance[j]);
			if(i==1)sprintf(buf, "%3.2f", slave_data[j]);
			//TEXT_SetTextColor(hItem,GUI_RED);
			TEXT_SetText(hItem, buf);
		}
	}
}

void addLabel(void)
{
	int i=0,j=0;
	int x=130,y=250;
	TEXT_Handle hObj;
	for(i=0;i<3;i++)
	{
		for(j=0;j<3;j++)
		{
			hObj = TEXT_CreateEx(x, y, 50, 20,hWinWindow, WM_CF_SHOW,TEXT_CF_LEFT, ID_1+i,"0");
			TEXT_SetFont(hObj, GUI_FONT_24_ASCII);
			TEXT_SetTextColor(hObj,GUI_RED);
			x+=250;
		}
		x=130;
		y+=50;
	}
}

